import React from 'react';

import './style.css';

export default function ModalCar({carObject}) {
    console.log(carObject); 
    return (
        <div style={style.parentDiv}>
            <div style={style.modalDiv}>
                <div style={style.headerModal}><h2>Carro</h2></div>
                <p style={style.headerModalText}>Marca: {carObject.car_manufacturer}</p>
                <p style={style.headerModalText}>Modelo: {carObject.car_model}</p>
                <p style={style.headerModalText}>Nome: {carObject.car_name}</p>
                <p style={style.headerModalText}>{carObject.car_fuel}</p>

            </div>
        </div>
    )
};

const style = {
    parentDiv: {
        backgroundColor: "rgb(163, 163, 163,0.8)",
        position: "absolute",
        zIndex: 10,
        width: "100%",
        height: "100%",
        display:"flex",
        justifyContent: "center",
        alignItems: "center"
    },

    modalDiv:{
        backgroundColor:"#fffafa",
        width:"50%", 
        height: "450px"
    },

    headerModal:{
        backgroundColor:"#ff8f8f",
        display:"flex",
        justifyContent: "center",
        alignItems: "center",
        width:"100%", 
        height: "70px",
    },

    headerModalText:{
        display:"flex",
        fontSize:"16px",
        justifyContent: "center",
        alignItems: "center"
    }
};
